--
-- TOC entry 241 (class 1259 OID 217112)
-- Name: language_proficiency_score; Type: VIEW; Schema: public; Owner: midas
--

CREATE VIEW language_proficiency_score AS
 SELECT lookup_code.lookup_code_id AS proficiency_id,
    lookup_code.code,
    lookup_code.value,
        CASE
            WHEN ((lookup_code.value)::text = 'None'::text) THEN (0)::numeric
            WHEN ((lookup_code.value)::text = 'Novice'::text) THEN 1.1111111
            WHEN ((lookup_code.value)::text = 'Intermediate'::text) THEN 2.2222222
            WHEN ((lookup_code.value)::text = 'Advanced'::text) THEN 3.3333333
            ELSE (0)::numeric
        END AS score
   FROM lookup_code
  WHERE (((lookup_code.lookup_code_type)::text = 'LANGUAGE_PROFICIENCY'::text) AND (lookup_code.is_disabled = false));


